import logo from './logo.svg';
import './App.css';
import Header from './HuddleComponents/Header.js';
import {AllTickets} from './HuddleComponents/AllTickets.js';
import {Footer} from './HuddleComponents/Footer.js';
function App(){
  let allTickets = [
    {
      sno:1,
      title : "Need a new server",
      description: "we need a new development server"
    },
    {
      sno:2,
      title : "Need a new memory",
      description: "we need a new development server"
    },
    {
      sno:3,
      title : "Need a new hdd",
      description: "we need a new development server"
    },
    {
      sno:4,
      title : "Need a new ssd",
      description: "we need a new development server"
    },
    {
      sno:5,
      title : "Need a new server",
      description: "we need a new development server"
    },
  ]
  return(
    <>
      <Header/>
      <AllTickets allTheTickets = {allTickets}/>
      <Footer/>
    </>
  );
}
